The Skalar San++ Flow Continuous Analyzer is a sophisticated and automated instrument designed for the analysis of various chemical parameters in liquid and solide samples (soils, fertilizers,waters, plant digests, nutrients, pharmaceuticals, etc.) It is commonly utilized in environmental, industrial, and laboratory settings to measure concentrations of specific compounds or elements including N,P,K,Ca,Fe,Na,Mg, etc. The San++ provides flexibility and the possibility to extend the system according to any analytical needs.
Spesifications:
-3 chemistry manifolds;
-High-resolution digital photometric detectors;
-Segmented Flow Analyzer;
The Flow Continuous Analyzer streamlines the analytical process, improves productivity, and delivers precise and consistent results, making it a valuable tool in various scientific and industrial fields.

